SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

DROP TABLE IF EXISTS `city`;
CREATE TABLE `city` (
  `code` char(10) NOT NULL,
  `state_code` char(5) NOT NULL,
  `name` varchar(30) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `country`;
CREATE TABLE `country` (
  `code` varchar(3) NOT NULL,
  `name` varchar(150) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `country_data`;
CREATE TABLE `country_data` (
  `id` int(10) UNSIGNED NOT NULL,
  `country_code` char(2) NOT NULL,
  `dkey` char(35) NOT NULL,
  `dvalue` char(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;


DROP TABLE IF EXISTS `lga`;
CREATE TABLE `lga` (
  `code` char(8) COLLATE latin1_bin NOT NULL,
  `state_code` char(5) COLLATE latin1_bin NOT NULL,
  `name` char(55) COLLATE latin1_bin NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COLLATE=latin1_bin;


DROP TABLE IF EXISTS `state`;
CREATE TABLE `state` (
  `code` char(5) NOT NULL,
  `country_code` char(2) NOT NULL,
  `name` varchar(30) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;



ALTER TABLE `city`
  ADD PRIMARY KEY (`code`);

ALTER TABLE `country`
  ADD PRIMARY KEY (`code`);

ALTER TABLE `country_data`
  ADD PRIMARY KEY (`id`);

ALTER TABLE `lga`
  ADD PRIMARY KEY (`code`);

ALTER TABLE `state`
  ADD PRIMARY KEY (`code`);


ALTER TABLE `country_data`
  MODIFY `id` int(10) UNSIGNED NOT NULL AUTO_INCREMENT, AUTO_INCREMENT=723;
COMMIT;
